" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 529px\">",
"   <div class=\"ttl\">",
"    Lifting techniques",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 509px; height: 282px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Improper lifting techniques (left panel) contribute to the high incidence of back injuries in the workplace. Keeping the knees straight while reaching out to pick up a heavy object significantly increases the forces on the spine. Proper lifting techniques (right panel) use good body mechanics to protect the spine. The patient should squat and keep the weight close to the body during the lifting process; the thigh muscles are used for power.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
