"   </div>",
"   <div class=\"lgnd\">",
"    High power photomicrograph of acute interstitial pneumonia (Hamman-Rich disease) shows marked alveolar septal thickening resulting from proliferating spindle cells. There is only a minor infiltrate of mononuclear inflammatory cells. The thickened alveolar septa are lined by hyperplastic pneumocytes.",
"    <div class=\"footnotes\">",
