"   </div>",
"   <div class=\"lgnd\">",
"    High power photomicrograph shows alveoli containing capillaries within a narrow interstitium. The alveoli are lined with thin, elongated type I pneumoctes (red arrow) and smaller numbers of cuboidal type II pneumocytes (green arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Steven E Weinberger, MD.",
"    </div>",
