var title_f14_18_14635="ACC AHA echo aortic stenosis";
var content_f14_18_14635=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F80790&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F80790&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ACC/AHA guideline summary: Echocardiography in aortic stenosis in adults (AS)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class I - There is evidence and/or general agreement that echocardiography should be performed in patients with AS in the following settings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; For the diagnosis of AS and assessment of the severity of the stenosis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; For the assessment of left ventricular wall thickness, size, and function.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; For re-evaluation of patients with changing symptoms or signs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; During pregnancy, for the assessment of changes in hemodynamic severity and left ventricular function.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; For re-evaluation of asymptomatic patients. The frequency varies with disease severity: yearly for severe AS, every one to two years for moderate AS, and every three to five years for mild AS.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Bonow RO, Carabello BA, Chatterjee K, et al. ACC/AHA 2006 guidelines for the management of patients with valvular heart disease. A report of the American College of Cardiology/American Heart Association Task Force on Practice Guidelines (Writing committee to revise the 1998 guidelines for the management of patients with valvular heart disease). J Am Coll Cardiol 2006; 48:e1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
