var title_f14_18_14637="Activity of antimicrobiol agents against anaerobes";
var content_f14_18_14637=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F73450&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F73450&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Activity of antimicrobiol agents against anaerobes",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Agent",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Nearly always active",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Metronidazole",
"       </td>",
"       <td>",
"        Inactive versus microaerophilic streptococci (eg, S.milleri), Propionibacterium, and Actinomyces species; bactericidal versus most gram-negative anaerobic strains",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Carbapenems",
"       </td>",
"       <td>",
"        Resistant to most Bacteroides &beta;-lactamases, although a novel &beta;-lactamase that cleaves carbapenems was found in rare B. fragilis strains*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &beta;-Lactam plus &beta;-lactamase inhibitors",
"       </td>",
"       <td>",
"        The addition of a &beta;-lactamase inhibitor to a &beta;-lactam dramatically increases activity against anaerobes that produce a &beta;-lactamase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Chloramphenicol",
"       </td>",
"       <td>",
"        Good activity versus virtually all clinically significant anaerobes&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Usually active",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Clindamycin",
"       </td>",
"       <td>",
"        B. fragilis group: 10 to 20 percent of strains resistant; some Clostridia other than C. perfringens are resistant",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cefamycins",
"       </td>",
"       <td>",
"        B. fragilis group: 5 to 15 percent of strains resistant with considerable institutional variation at least partly reflecting use patterns; poor activity versus Clostridia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antipseudomonal",
"       </td>",
"       <td>",
"        Relatively resistant to &beta;-lactamases of Bacteroides spp; penicillins large doses usually employed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Variable activity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Penicillin",
"       </td>",
"       <td>",
"        Inactive versus some or most penicillinase-producing anaerobes, including most of the B. fragilis group and many strains of Prevotella melaninogenica, P. intermedia, P. bivia, P. disiens, and some Clostridia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cephalosporins",
"       </td>",
"       <td>",
"        Less activity in vitro than penicillin G versus most anaerobes and limited other than cefamycins published clinical experience to document efficacy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Tetracycline",
"       </td>",
"       <td>",
"        Inactive versus many anaerobes and most strains of B.fragilis; doxycycline and minocycline are somewhat more active than tetracycline",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vancomycin",
"       </td>",
"       <td>",
"        Active against Gram positive anaerobes; inactive versus gram-negative anaerobes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Macrolides",
"       </td>",
"       <td>",
"        Inactive versus many Fusobacterium spp. and some B. fragilis spp.; ketolides also show reduced activity versus Fusobacteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fluoroquinolones",
"       </td>",
"       <td>",
"        Moxifloxacin is the best in this class for anaerobic infections, but the B. fragilis group shows increasing resistance and is no longer recommended in the IDSA guidelines for intra-abdominal sepsis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Tigecycline",
"       </td>",
"       <td>",
"        Active against nearly all anaerobes including strains of B. fragilis that are resistant to beta-lactams, clindamycin and quinolones. MICs are somewhat higher for Clostridia.&Delta;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Poor activity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Aminoglycosides",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Trimethoprim-sulfamethoxazole",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Monobactams (aztreonam)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Edwards, R, et al. J Antimicrob Chemother 1999; 43:273.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      While in vitro activity is excellent, clinical failures with chloramphenicol have been documented, rendering this drug less preferable than other active agents for the treatment of anaerobic infections.",
"      <br>",
"       &Delta; Snydman, DR, etal. J Antimcrob Chemother 2005; 55:10124.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
